

BEGIN;

	SELECT pg_catalog.setval('clinicalcode_operator_id_seq', 40, true);


	SELECT pg_catalog.setval('clinicalcode_codingsystem_id_seq', 12, true);
	
	-- add the clinicalcode_codingsystemfilter







	SELECT pg_catalog.setval('clinicalcode_codingsystemfilter_coding_system_filter_id_seq', 71, true);
	

