	DELETE FROM clinicalcode_codingsystemfilter_operators  WHERE (codingsystemfilter_id >= 39 and codingsystemfilter_id <= 44);
	DELETE FROM clinicalcode_codingsystemfilter  WHERE (coding_system_filter_id >= 39 and coding_system_filter_id <= 44);

	DELETE FROM clinicalcode_codingsystemfilter_operators  WHERE (codingsystemfilter_id >=66 and codingsystemfilter_id <= 71);
    DELETE FROM clinicalcode_codingsystemfilter  WHERE (coding_system_filter_id >= 66 and coding_system_filter_id <= 71);

    DELETE FROM clinicalcode_codingsystemfilter_operators  WHERE (codingsystemfilter_id  in(5, 16 , 17, 18, 19, 21, 22, 23));
    DELETE FROM clinicalcode_codingsystemfilter  WHERE (coding_system_filter_id   in(5, 16 , 17, 18, 19, 21, 22, 23));

	DELETE FROM clinicalcode_codingsystemfilter_operators WHERE (codingsystemfilter_id  in(29, 30, 31, 33, 34, 35));
	DELETE FROM clinicalcode_codingsystemfilter  WHERE (coding_system_filter_id   in(29, 30, 31, 33, 34, 35));



COMMIT;